var http = require("http");

var options = {
  "method": "POST",
  "hostname": "localhost",
  "port": "8000",
  "path": "/create",
  "headers": {
    "content-type": "application/json",
    "cache-control": "no-cache",
    "postman-token": "4c4ac10b-383d-a334-dad1-533c71ffa5e9"
  }
};

var req = http.request(options, function (res) {
  var chunks = [];

  res.on("data", function (chunk) {
    chunks.push(chunk);
  });

  res.on("end", function () {
    var body = Buffer.concat(chunks);
    console.log(body.toString());
  });
});

req.write(JSON.stringify({ dataUri: 'data:image/webp;base64,',
  name: 'a.jpg' }));
req.end();
